import React from "react";
import { Form, Button } from "../../../semantic-ui-react";

class LoginForm extends React.Component {
	state = {
		data: {},
		loading: false,
		errors: {}
	}// state

	render() {
		return(
			<Form>
				<Button primary>Login</Button>
			</Form>
		);
	}// render

}

export default LoginForm;
